import styled from 'styled-components';

const HeroContentWrapper = styled.div`
  width: 100%;
  padding-top: 80px;
  padding-bottom: 80px;
  height: auto;
  @media (min-width: 701px) {
    width: 66.7%;
  }
`;

const HeroTile = styled.div`
  font-size: 28px;
  font-weight: bold;
  margin-bottom: 2.2rem;
  line-height: normal;
  @media (min-width: 701px) {
    font-size: 40px;
  }
`;

const Main = () => (
  console.log("**** client/src/Components/Main"),
  <main className="px-3">
    <HeroContentWrapper>
    <HeroTile>Find a service provider.</HeroTile>
    <form className="search">
      <div className="form-group">
        <label htmlFor="provider">Search for a service provider:</label>
        <input/>
        <button type="submit" className="btn btn-success">
          Search
        </button>
      </div>
    </form>
    </HeroContentWrapper>
  </main>
);

export default Main;
